Traits provide some pre-implemented methods, fields and constructors and some pre-defined methods, fields and constructors that must be implemented by a child class or trait. They are defined with the following syntax. trait MyTrait { } You can add a method, constructor or variable to a trait with the following syntax. trait MyTrait { var x: Int; func myTraitFunc(x: Int) -> Int; build (y: Int);
} This method and constructor have not been implemented by the trait so it must be implemented by a child class or trait with the following syntax. class MyClass : MyTrait { impl func myTraitFunc(x: Int) -> Int { ret = x + 5; } impl build (x: Int) { x = y; }
} Fields DO NOT need to be implemented by a child class or trait as they have a default "Getter, Setter" implementation. They, along with methods and constructors with a default implementation, can still be implemented to override the default implementation. The "Setter" of a field CAN NOT be accessed outside constructors or methods that have been marked to mutate the object. The Setter of a field CAN NOT be overridden; because of the immutability of objects there is simply no need. A field's "Getter" can be implemented using the following syntax. class MyClass : MyTrait { impl var x: Int { ret = x; }
}

