A method can be added to a class using the following syntax. class MyClass { var myField: Int; func myFunc(x: Int) -> Int { ret = myField + x; }
} A method CAN NOT mutate any of the objects fields. The following code would not compile for that reason. class MyClass { var myField: Int; func myFunc(x: Int) { myField += x; }
}
